import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

import NotesListPage from "./pages/NotesListPage";


function App() {
  return (
    <BrowserRouter> 
    <Routes>
    <div className="App">

    <Route path ="/" component={NotesListPage}/>

    </div>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
